import {Routes, Route} from "react-router-dom"
import Navbar from './components/Navbar'
import{ Registration} from "./components/Registration"


function App() {
  return (
    <>

      <Navbar />
      <Routes>
        <Route path="/" element={<Registration />} />
      </Routes>
    </>
  );
}

export default App;
